import { StatusBar } from 'expo-status-bar';
import React from 'react';
import {  ImageBackground, StyleSheet, Text, View, Image, TextInput, Button, Alert } from 'react-native';

export default function App() {
  return (
    <ImageBackground source={require('./assets/backgroundLogin.jpg')} style={styles.background}>
    <View style={styles.body}>

      {/* <Text>Enfim meu primeiro APP!</Text>
      <StatusBar style="auto" /> */}
      <View style={styles.navbar}>
      <Image source={require('./assets/logo2.png')} style={styles.logo}/>
      </View>
      <View style={styles.container}>


        <TextInput style={styles.input} placeholder="Digite seu usuario"/>

        <TextInput style={styles.input} placeholder="Digite sua senha"
        secureTextEntry={true} />

        <Button style={styles.button} title="Login" onPress={() => Alert.alert('Alerta de clique!')}/> 
        <Button class="button" title="limpa" onPress={() => Alert.alert('Alerta de clique!')} />
      </View>

    </View>
    </ImageBackground>
  );
}

const styles = StyleSheet.create({
  body:{
    flex: 1,
    backgroundColor: 'rgba(235, 242, 22, 0.800)',
  },
  background:{
    width: 400,
    height: 560,
    justifyContent: 'center',
  },
  logo:{
    marginTop: '150px',
    width: '250px',
    height: '100px'
  },

  navbar:{

    alignItems: 'center',
    justifyContent: 'center',

    margin: '10px',

    width: '100%',
    height: '110px'
  },
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },

  input:{
    marginTop: 10,
    padding: 10,
    width: 250,

    backgroundColor: 'rgba(222, 222, 222, 0.600)',
    borderRadius: 50,

    fontSize: 15,

  },
  button: {
    width: 250,

  }
});
